<?phpnamespace Nemundo\Roundshot\App\Container\Data\RoundshotContainer;class RoundshotContainerPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var RoundshotContainerModel*/public $model;public function __construct() {parent::__construct();$this->model = new RoundshotContainerModel();}/*** @return RoundshotContainerRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new RoundshotContainerRow($dataRow, $this->model);$list[] = $row;}return $list;}}